import { useState,useEffect } from "react";

const Users = () => {
    let [userData,setData]=useState([])
    useEffect(()=>{
        let fetchData = async() =>{
            let response = await fetch("https://api.github.com/users")
            let data = await response.json()
            setData(data)
        }
        fetchData()
    })
    return ( 
        <div className="users">
            <h1>Users page</h1>
            {userData.map((data)=>(
                <div className="userList">
                    
                </div>
            ))}
        </div>
     );
}
 
export default Users;
